{
if (上行键[i] == 1)
{
上行遍历(i);
}
if (上行键[i] >= 5)
{
if (i == 电梯线程[上行键[i] - 5].取得目标楼层())
{
上行键[i] = 0;
upButton[i].改变颜色。
//System.out.println("unPressedUpDownColor");
}
}
}

//处理向下键
for (int i = 0; i < 下行.length; i++)
{
if (下行[i] == 1)
{
下行遍历(i);
}
if (下行[i] >= 5)
{
if (i == 电梯线程[下行[i] - 5].取得目标楼层())
{
下行[i] = 0;
下行[i].改变颜色。
}
}
}

寻找响应向上键最近的电梯
private boolean upLookForList(int 楼层)
{
int 选择电梯 = 0;
int 距离 = 楼层数;

for (int j = 0; j < 电梯线程个数; j++)
{
if (电梯线程[j].闲置()
|| (电梯线程[j].下降() && 楼层 >= 电梯线程[j].取得目标楼层()))
{
int temp = Math.abs(楼层 - 电梯线程[j].取得目标楼层());
if (temp < 距离)
{
选择电梯 = j;
距离 = Math.abs(楼层 - 电梯线程[j].取得目标楼层());
}
}
}

if (距离 != 楼层数)
{
上行键[楼层] = 5 + 选择电梯;
电梯线程[选择电梯].设置目标楼层(楼层);
return true;
} else
{
return false;
}

// 寻找响应向下键最近的电梯
private boolean downLookForList(int 楼层)
{
int 选择电梯 = 0;
int 距离 = 楼层数;

for (int j = 0; j < 电梯线程个数; j++)
{
if (电梯线程[j].闲置()
|| (电梯线程[j].下降() && 楼层 <= 电梯线程[j].取得目标楼层()))
{
int temp = Math.abs(楼层 - 电梯线程[j].取得目标楼层());
if (temp < 距离)
{
选择电梯 = j;
距离= Math.abs(楼层 - 电梯线程[j].取得目标楼层());
}
}
}

if (距离 != 楼层数)
{
下楼按钮[楼层] = 5 + 选择电梯;
电梯线程[选择电梯].设置目标楼层(楼层);
return true;
} else
{
return false;
}

public void 鼠标点击(MouseEvent e)
{
for (int i = 0; i < 按钮数量; i++)
{
if (e.按钮() == 所安按钮[i])
{
数字按钮[i] = true;
按钮状态改变

if (方向 == 停)
{
目标楼层 = i;
}

if (方向 == 上)
{
目标楼层 = 最大楼层();
}
if (方向 == 下)
{
目标楼层 = 最大楼层();
}
}
}
}
}

public void run()
{
while (true)
{
try
{
Thread.sleep(100);
} catch (InterruptedException e)
{
e.printStackTrace();
}
if (方向 == 上 || 方向 == 下)
{
try
{
Thread.sleep(100);
} catch (InterruptedException e)
{
e.printStackTrace();
}
方向 = 停;
//System.out.println("if (direction == UP || direction == DN)");
}
if (目标楼层 > 所在楼层)
{
方向 = 上;
dispState.setText("上行");
moveUp();
方向 = 停;
dispState.setText("停止");
} else if (目标楼层 < 所在楼层)
{
方向 = 下;
dispState.setText("下行");
moveDn();
方向 = 停;
dispState.setText("停止");
}

