public void 电梯调度。普通方法()
{
for (int i = 0; i < 电梯号; i++)
{
for(int j = 0;j< 楼层号; j++)
{
解开电梯锁;}
}
}

public void 电梯调度。奇偶算法()
{
for (int i = 0; i < 电梯号; i++)
{
if(i%0 == 0){
for(int j = 0;j< 楼层号; j++)
{
if(j%2 == 0)奇数设置电梯锁
解开解开电梯锁;};};
锁上电梯锁;}(j);
}
}
if(i%0 == 1){ 偶数设置电梯锁
for(int j = 0;j< 楼层号; j++)
{
if(j%0 == 1 || j==1)
解开解开电梯锁;};};
锁上电梯锁。
}
}
}
}

public void 电梯调度。高分算法()
{
for (int i = 0; i < 电梯号; i++)
{
if(i%0 == 0){
for(int j = 0;j< 楼层号; j++)
{
if(j<电梯数<2)设置半数电梯锁
解开解开电梯锁;};};
锁上电梯锁;}(j);
}
}
}
}

